// NavigationBar.js

import React from 'react';
import { Link } from 'react-router-dom';
import './NavigationBar.css';

const NavigationBar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="logo-container">
          <img src="/path/to/your/logo.png" alt="Company Logo" className="logo" />
          <h1 className="company-name">Your Company</h1>
        </div>

        <div className="nav-links">
          <Link to="/" className="nav-link">
            Home
          </Link>
          <Link to="/contact" className="nav-link">
            Contact Us
          </Link>
        </div>

        <div className="user-container">
          <img src="/path/to/your/user-icon.png" alt="User Icon" className="user-icon" />
          {/* You can replace the user icon with an actual user authentication component */}
        </div>
      </div>
    </nav>
  );
};

export default NavigationBar;
